function asd(input) {
  let n = Number(input[0]);
  let sales = 0;
  let rating = 0;
  let last = 0;
  let firstTwo = 0;

  for (let i = 1; i <= n; i++) {
    let pcs = input[i];
    last = Number(pcs[2]);
    firstTwo = Number(pcs[0] + pcs[1]);
    rating += last;

    if (last === 2) {
      sales += 0;
    } else if (last === 3) {
      sales += firstTwo / 2;
    } else if (last === 4) {
      sales += firstTwo * 0.7;
    } else if (last === 5) {
      sales += firstTwo * 0.85;
    } else {
      sales += firstTwo;
    }
  }
  console.log(sales.toFixed(2));
  console.log((rating / n).toFixed(2));
}

